import "./Home.scss";

import Banner from "./Banner/Banner"
import Category from "./Category/Category";

const Home = () => {
    return <div className="home">
        <Banner/>
        <div className="main-content">
            <div className="layout"></div>
        </div>
        <Category/>
        <Category/>
    </div>;

};

export default Home;
